import React from "react";
import reactDom from "react-dom/client";
import { Route, Routes, BrowserRouter } from "react-router-dom";
import {
    Navbar,
    Profile,
    Posts
} from './components'

const App = () => {
    return (
        <div>
            <Navbar />
            <Routes>
                <Profile />
                <Posts />
            </Routes>

        </div>

    )
}
 container = document.querySelector('#container')
 const root = reactDom.createRoot(container)
 root.render(
    <BrowserRouter>
        <App />
    </BrowserRouter>
 )
